import React from 'react'
import { DataGrid } from '@material-ui/data-grid';
import './userList.css'

export default function UserList() {

    const columns = [
        { 
            field: 'id', 
            headerName: 'ID', 
            width: 90 
        },
        {
          field: 'usuario',
          headerName: 'Nombre Usuario',
          width: 200,
          editable: true,
        },
        {
          field: 'avatar',
          headerName: 'Avatar',
          width: 120,
          editable: true,
        },
        {
          field: 'correo',
          headerName: 'Correo',
          width: 200,
          editable: true,
        },
        {
            field: 'rut',
            headerName: 'Rut',
            width: 110,
            editable: true,
          }
      ];

      const rows = [
        { id: 1, usuario: 'Snow', firstName: 'Jon', age: 35 },
        { id: 2, usuario: 'Lannister', firstName: 'Cersei', age: 42 },
        { id: 3, usuario: 'Lannister', firstName: 'Jaime', age: 45 },
        { id: 4, usuario: 'Stark', firstName: 'Arya', age: 16 },
        { id: 5, usuario: 'Targaryen', firstName: 'Daenerys', age: null },
      ];


    return (
        <div className='userList'>
            <DataGrid
                rows={rows}
                columns={columns}
                pageSize={5}
                checkboxSelection
            />
        </div>
    )
}
